      SELECT ALL + + 63 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col2 + - col1 NOT BETWEEN - + col0 AND - 11 + + 23 + + ( - col2 ) + + 7 + - + col0;
  - name: tab0

outputs:
  - name: q697.out
    data: |
